import "./ProjectComponent.css";

const images = require.context('./', true);

function ProjectComponent(props) {
  return (
  <div className="project-container">
    <div id="ptitle-container">
      <div id="project-title">{props.name}</div>
    </div>
    <div id="image-text">
      <div id="pimage">
        <img id="image" src={images(`./${props.name}.jpg`)} alt={`${props.name}`} height="50%" width="50%"/>
      </div>
      <div id="pdesc">{props.desc}</div>
    </div>
  </div>
  );
}

export default ProjectComponent;
